 они находятся на отдалённых от объектов 1.1. и 1.2. островах.\n3. На планете находится твёрдая плазма в огромных количествах. Её можно найти почти везде.\n  Секториальный штаб надеется, что объект оправдает все ожидания и сможет в должной мере защитить экипаж от непредвиденных переохлаждений.\n\nСлава NanoTrasen!\n[/italic][/color]\n=============================================\n                                [italic]Место для печатей[/italic]"
